import React, { Component } from "react";
import "./usercard.css";

function Card(props) {
  const data = props.Data;
  {
    data && console.log(data.data.data);
  }
  return (
    <>
      <div>
        {props.status ? (
          data.data.data.map((items, index) => {
            return (
              <div id="card" key={index}>
                <div>
                  <img className="avatar-img" src={items.avatar} />
                </div>
                <div>
                  <h3>{`${items.first_name}  ${items.last_name}`}</h3>
                  <h5>{`${items.email}`}</h5>
                </div>
              </div>
            );
          })
        ) : (
          <div>
            <div style="width:100%;height:0;padding-bottom:100%;position:relative;">
              <iframe
                src="https://giphy.com/embed/l3nWhI38IWDofyDrW"
                width="100%"
                height="100%"
                style="position:absolute"
                 
                className="giphy-embed"
                allowFullScreen
              ></iframe>
            </div>
            <p>
              <a href="https://giphy.com/gifs/thinking-l3nWhI38IWDofyDrW">
                via GIPHY
              </a>
            </p>
          </div>
        )}
      </div>
    </>
  );
}

export default Card;
